void inputCscHdrWrite2RegisterMaserati(cscParametersStructure* cscParameters)
{
    S16 s16Regs[3][3];
    U16 u16Regs[3][3];
    MS_U8 i,j;
    S16 temp;
    MS_U32 offset1,offset2,offset3;
    MS_U32 offsetY,offsetCb,offsetCr;
    if (FALSE == cscParameters->cscEnable)
    {
        writeByteMask(DoVi_Addr_H(0x7B, 0x7), (0x3 << 0), 0x1,E_IP);
        writeByteMask(DoVi_Addr_L(0x7B, 0x7), (0x1 << 1), (0x1 << 1),E_IP);
        write2Bytes(DoVi_Addr_L(0x7B, 0x08), 0x0,E_IP);
        write2Bytes(DoVi_Addr_L(0x7B, 0x09), 0x0,E_IP);
        write2Bytes(DoVi_Addr_L(0x7B, 0x0A), 0x2000,E_IP);
        write2Bytes(DoVi_Addr_L(0x7B, 0x0B), 0x2000,E_IP);
        write2Bytes(DoVi_Addr_L(0x7B, 0x0C), 0x0,E_IP);
        write2Bytes(DoVi_Addr_L(0x7B, 0x0D), 0x0,E_IP);
        write2Bytes(DoVi_Addr_L(0x7B, 0x0E), 0x0,E_IP);
        write2Bytes(DoVi_Addr_L(0x7B, 0x0F), 0x2000,E_IP);
        write2Bytes(DoVi_Addr_L(0x7B, 0x10), 0x0,E_IP);
        write4Bytes(DoVi_Addr_L(0x7B, 0x11), 0x0,E_IP);
        write4Bytes(DoVi_Addr_L(0x7B, 0x13), 0x0,E_IP);
        write4Bytes(DoVi_Addr_L(0x7B, 0x15), 0x0,E_IP);
        write2Bytes(DoVi_Addr_L(0x7B, 0x17), 0x0,E_IP);
        write2Bytes(DoVi_Addr_L(0x7B, 0x18), 0xffff,E_IP);
        write4Bytes(DoVi_Addr_L(0x7B, 0x19), 0x10000,E_IP);
    }
    else
    {

        for( i = 0; i < 3; i++)
            for( j = 0; j < 3; j++)
            {
                temp = ((( abs(cscParameters->cscCoeff[i][j]) << 13)+ 25000) / 50000);
                s16Regs[i][j] = (cscParameters->cscCoeff[i][j] >= 0) ? temp & 0xFFFF : (-1*temp) &0xFFFF;
                u16Regs[i][j] = (cscParameters->cscCoeff[i][j] >= 0) ? temp & 0xFFFF : (-1*temp) &0xFFFF;
            }

            offsetCr = (1 == cscParameters->rOrCrSub16) ? 16<<6 : (1 == cscParameters->rOrCrRangeSub128) ? 128<<6 : 0;
            offsetY = (1 == cscParameters->gOrYSub16) ? 16<<6 : (1 == cscParameters->gOrYRangeSub128) ? 128<<6 : 0;
            offsetCb = (1 == cscParameters->bOrCbSub16) ? 16<<6 : (1 == cscParameters->bOrCbRangeSub128) ? 128<<6 : 0;
            offset1 = (s16Regs[0][1] * offsetY) + (s16Regs[0][2] * offsetCr) + (s16Regs[0][0] * offsetCb);
            offset2 = (s16Regs[1][1] * offsetY) + (s16Regs[1][2] * offsetCr) + (s16Regs[1][0] * offsetCb);
            offset3 = (s16Regs[2][1] * offsetY) + (s16Regs[2][2] * offsetCr) + (s16Regs[2][0] * offsetCb);
/*
            offset1 *= 64;
            offset2 *= 64;
            offset3 *= 64;*/
            /*MS_BOOL rOrCrSub16;
            MS_BOOL gOrYSub16;
            MS_BOOL bOrCbSub16;
            MS_BOOL rOrCrRangeSub128;
            MS_BOOL gOrYRangeSub128;
            MS_BOOL bOrCbRangeSub128;*/
/*
            write2Bytes(DoVi_Addr_L(0x7B, 0x08), u16Regs[0][1]);
            write2Bytes(DoVi_Addr_L(0x7B, 0x09), u16Regs[1][1]);
            write2Bytes(DoVi_Addr_L(0x7B, 0x0A), u16Regs[2][1]);
            write2Bytes(DoVi_Addr_L(0x7B, 0x0B), u16Regs[0][2]);
            write2Bytes(DoVi_Addr_L(0x7B, 0x0C), u16Regs[1][2]);
            write2Bytes(DoVi_Addr_L(0x7B, 0x0D), u16Regs[2][2]);
            write2Bytes(DoVi_Addr_L(0x7B, 0x0E), u16Regs[0][0]);
            write2Bytes(DoVi_Addr_L(0x7B, 0x0F), u16Regs[1][0]);
            write2Bytes(DoVi_Addr_L(0x7B, 0x10), u16Regs[2][0]);
            */
        writeByteMask(DoVi_Addr_H(0x7B, 0x7), (0x3 << 0), 0x1,E_IP);
        writeByteMask(DoVi_Addr_L(0x7B, 0x7), (0x1 << 1), (0x1 << 1),E_IP);
        write2Bytes(DoVi_Addr_L(0x7B, 0x08), u16Regs[0][1],E_IP);
        write2Bytes(DoVi_Addr_L(0x7B, 0x09), u16Regs[0][2],E_IP);
        write2Bytes(DoVi_Addr_L(0x7B, 0x0A), u16Regs[0][0],E_IP);
        write2Bytes(DoVi_Addr_L(0x7B, 0x0B), u16Regs[1][1],E_IP);
        write2Bytes(DoVi_Addr_L(0x7B, 0x0C), u16Regs[1][2],E_IP);
        write2Bytes(DoVi_Addr_L(0x7B, 0x0D), u16Regs[1][0],E_IP);
        write2Bytes(DoVi_Addr_L(0x7B, 0x0E), u16Regs[2][1],E_IP);
        write2Bytes(DoVi_Addr_L(0x7B, 0x0F), u16Regs[2][2],E_IP);
        write2Bytes(DoVi_Addr_L(0x7B, 0x10), u16Regs[2][0],E_IP);
        write4Bytes(DoVi_Addr_L(0x7B, 0x11), offset1,E_IP);
        write4Bytes(DoVi_Addr_L(0x7B, 0x13), offset2,E_IP);
        write4Bytes(DoVi_Addr_L(0x7B, 0x15), offset3,E_IP);
        write2Bytes(DoVi_Addr_L(0x7B, 0x17), 0x0,E_IP);
        write2Bytes(DoVi_Addr_L(0x7B, 0x18), 0xffff,E_IP);
        write4Bytes(DoVi_Addr_L(0x7B, 0x19), 0x10000,E_IP);
    }
}
