U32 pow01_16In32Out(MS_U16 data_base, MS_U32 data_exp)
{
    // returns data_base^data_exp
    // data_base : 0.16 (0xFFFF->1.0)
    // data_exp : 16.16  (0x10000->1.0)
    // data_out : 0.32  (0xFFFFFFFF->1.0)

              MS_U8 i;
        MS_U16 u16reg_eidb[33] = {0,0,1,2,3,3,3,4,4,4,5,5,5,6,7,8,0 };
        MS_U8 u1Mul[33] =        {0,0,0,0,0,1,2,2,3,4,4,5,6,6,6,6,0} ;
              MS_U8 u8ExpTableResolution[55] =    {15,14,13,12,11,10,9,8,7, 6, 5, 4, 4, 4,4, 4, 3 ,2, 2, 2, 2, 2,2} ;
              MS_U8 u8digit;
              MS_U32 sum;
        U8 u8lsbBitsNumber;
        U32 u32lsbBits;
        U32 u32IdxBits ;
        MS_U32 idx=0, lsb,msb=15;
        U32  log_res, xlog_res, final_res;
        MS_U32 data_base_temp;
        MS_U8 u8I;

              if (data_base == 0)
            return 0;
           if (data_exp == 0)
            return 0xFFFFFFFF;
        while( ( (1<<msb & data_base) == 0) && (msb>0) )
        {
            msb--;
        }
        for(u8I =0; u8I<msb; u8I++)
        {

            idx += 1<<(u16reg_eidb[u8I]+1);
        }

        data_base_temp = data_base;

        u8lsbBitsNumber = (u1Mul[msb]);
        u32lsbBits = ((1<<u8lsbBitsNumber)-1);

        u32IdxBits = (((1<<(u16reg_eidb[msb]+1))-1)<<u1Mul[msb]);
        idx =idx + ((u32IdxBits & data_base) >> (u1Mul[msb]));
        lsb = data_base & u32lsbBits;
        u32lsbBits = max(u32lsbBits, 1);
        log_res = logTable_pow01_16In32Out[idx] - (((U64)logTable_pow01_16In32Out[idx] - logTable_pow01_16In32Out[idx+1]) * lsb )/ u32lsbBits;


        //log_res : x:22 , data_exp : x:16
        xlog_res = (MS_U64)((MS_U64)data_exp * (MS_U64)log_res) >> 16;

        u8digit = min(xlog_res>>22,22);
        sum = 0;
        for( i = 0 ; i < u8digit;i++)
        {
            sum += (1<<u8ExpTableResolution[i]);
        }
        u8lsbBitsNumber = 22 - u8ExpTableResolution[u8digit];
        u32lsbBits = ((1<<u8lsbBitsNumber)-1);
        u32IdxBits = (((1<<u8ExpTableResolution[u8digit])-1)<<u8lsbBitsNumber);
        idx = sum + ((xlog_res & u32IdxBits)>>u8lsbBitsNumber);
        lsb = xlog_res & u32lsbBits;//4
           u32lsbBits = max(u32lsbBits, 1);
        final_res = (U64)expTable_pow01_16In32Out[idx]- ((((U64)expTable_pow01_16In32Out[idx] - expTable_pow01_16In32Out[idx+1]) * ( lsb)) /(u32lsbBits));



        return final_res;
}
U32 newPow04(MS_U32 data_base, MS_U32 data_exp)
{
    if (0xFFFF >= data_base)
    {
        return ((pow01_16In32Out(data_base,  data_exp))+(1<<2))>>3;
    }
    else
    {
        //return newPow14( data_base+3,  data_exp);
        //data_base = (data_base & 0x10000 == 0x10000) ? (data_base+1) : (data_base & 0x20000 == 0x20000) ? (data_base+2) : data_base;
        if(data_base>=0xffff)
            data_base++;
        if(data_base>=0x1ffff)
            data_base++;

        return newPow125( data_base,  data_exp)<<13;
    }
}
U32 MDrv_HDR_PQ_ali(MS_U32 u16In)
{

    MS_U32 u16Shift, u16Idx, u16Lsb, u16Tmp, u16Exp;
    U32 u32Lut0_out, u32Lut1_out, u32Result;
    if (u16In == 0)
        return 0;
    if (u16In > 0xFFFF)
        u16In = 0xFFFF;

    u16Tmp = u16In;
    for (u16Shift = 0; u16Tmp > 127; u16Shift++)
        u16Tmp >>= 1;
    u16Idx = (u16In >> u16Shift) + 64*u16Shift;
    u16Lsb = u16In & ((0x1 << u16Shift) - 1);
    u32Lut0_out = u16PQCurveMantLut_ali[u16Idx];
    u32Lut1_out = u16PQCurveMantLut_ali[u16Idx+1];
    u16Exp = u16PQCurveExpLut_ali[u16Idx];
    if (u16Exp != u16PQCurveExpLut_ali[u16Idx+1])
        u32Lut1_out <<= 1;
    if (u16Shift > u16PQCurveExpLut_ali[u16Idx])
        u32Result = (u32Lut0_out << u16Exp) + ((u32Lut1_out - u32Lut0_out) * u16Lsb >> (u16Shift - u16Exp));
    else
        u32Result = (u32Lut0_out << u16Exp) + ((u32Lut1_out - u32Lut0_out) * u16Lsb << (u16Exp - u16Shift));
    //printk("%x -> %x; %x %x %x %x %x %x\n", u16In, u32Result, u16Idx, u16Lsb, u32Lut0_out, u32Lut1_out, u16Shift, u16Exp);
    return u32Result;
}

U32 MDrv_HDR_DeGamma_ali(MS_U16 u16In, MS_U16 u16Gamma, MS_U16 u16Ginv, MS_U16 u16A, MS_U16 u16B, MS_U16 u16S)
{
    // u16Gamma : 4.12
    // u16GInv  : 1.12
    // u16A : 1.15
    // u16B : 0.16
    // u16S : 6.10
    U32 u32Th, u32Tmp, u32Out;
    if(0 == u16S)
    {
        u16S = 0x400;
    }
    if(0 == u16A)
    {
        u16A = 0x8000;
    }
    u32Th = (U32)u16S * u16B >> 10;
    if (u16In <= u32Th)
        return ( ( (U64)u16In << 10) /( u16S) )<< (16);
        //return (( ((U64)u16In << 10) /( u16S) )+ 0x8)>>4;//<< 16;
    //u32Tmp = (U32)(u16In + ((u16A - 0x7FFF/*0x7F80*/) << 1)) * 0x7FFF / u16A;
    u32Tmp = ((U64)(u16In + ((u16A - 0x8000/*0x7FFF*//*0x7FF6*//*0x7FF6*/) << 1)) << 15) / u16A;
    u32Out = MDrv_HDR_Pow_ali(u32Tmp /*+ (u32Tmp>>15)*/, u16Gamma);
    return (u32Out)<< (16);
}
