    //u32Out = MDrv_HDR_Pow(u32Tmp + (u32Tmp>>15), u16Ginv);
    u32Out = ( (((MDrv_HDR_Pow_ali(u16In, u16Ginv))*u16A)+(1<<14))>>15) - ((u16A - 0x7FFF/* 0x7F80*/) << 1);
