// function: MDrv_HDR_PQ_OETF_lavend
// note: transfer luminance to PQ code
// input: u32In (14.16)
// output: u32Out (10.16)
// reference functions: U32 MDrv_HDR_Pow(MS_U16 data_base, MS_U16 data_exp)
//***************************************************************************************************************************************************
MS_U32 MDrv_HDR_PQ_OETF_lavend(MS_U32 u32In){
    MS_U16 b,data_out;
    MS_U32 u32Out;

    // L^m1
     b = MDrv_HDR_Pow_ali(u32In/10000, 2610>>2); //0.16
    //(c1+c2*b)/(1+c3*b)
     data_out = (((MS_U64)107<<32) + (((MS_U64)2413 * b)<<16) )/ (((MS_U64)128<<16) + (MS_U64)2392* b );
    data_out = (data_out > 0)? data_out: 0;
    //data_out^m2;
     u32Out = MDrv_HDR_Pow_ali(data_out, 2523<<4);
    u32Out = MDrv_HDR_Pow_ali(u32Out, 1<<15)<<10;

    return u32Out;
}
//***************************************************************************************************************************************************
// function: MDrv_HDR_GetSlopeOfGamma2PQ
// note: get slope of gamma2PQ curve at entry of gamma
// input: u8Entry(0.8), u16MaxInNits (16)
// output: u16Slope (9.7)
// reference functions: U32 MDrv_HDR_DeGamma(MS_U16 u16In, MS_U16 u16Gamma, MS_U16 u16Ginv, MS_U16 u16A, MS_U16 u16B, MS_U16 u16S)
//                      MS_U32 MDrv_HDR_PQ_OETF(MS_U32 u32In)
//***************************************************************************************************************************************************
void MDrv_HDR_GetSlopeOfGamma2PQ_lavend(MS_U16* pu16Slope,
                                        MS_U8* u8Entry,
                                        MS_U8 u8InputLength,
                                        MS_U16 u16MaxInNits)
{

    MS_U8 u8LoopIdx;
    MS_U8 u8Shift = 0;
    MS_U16 u16Entry = 0;
    MS_U16 u16Hb_entry = 0;
    MS_U16 u16Lb_entry = 0;
    MS_U32 u32Hb_Degamma = 0;
    MS_U32 u32Lb_Degamma = 0;
    MS_U32 u16Hb_PQ = 0;
    MS_U16 u16Lb_PQ = 0;
    MS_U16 u16SlopeTemp = 0;

    // Set DeGamma Infomation=
    MS_U16 u16Gamma, u16A, u16B, u16S, u16Ginv;
    //gamma 2.2
    u16Gamma = 0x8CCD>>2; // 2.2
    u16B = 0; // 0
    u16Ginv = 0x1000000ul / u16Gamma; // (1<<24) / 4.12 -> 1.12
    //u16S = 0;
    u16S = 1;
    u16A = 0x8000; // value = 1.0

    // Get slope of Gamma2PQ by difference between hb and lb of 24 entries
    //MS_U8 u8LoopIdx;
    for( u8LoopIdx = 0; u8LoopIdx < u8InputLength; u8LoopIdx ++ ){
        // Get hb, lb, shift of entry
        u16Entry = u8Entry [u8LoopIdx] << 8 ; //0.16 (16 - 8 = 8)
        u16Hb_entry = u16Entry + ((0xfc <= u8Entry[u8LoopIdx])? 0:  0x0400);
        u16Lb_entry = u16Entry + ((0x04 >= u8Entry[u8LoopIdx])? 0: -0x0400);
        u8Shift = (u16Hb_entry-u16Lb_entry)>>10;

        // Do Degamma on hb, lb
        u32Hb_Degamma = ((MDrv_HDR_DeGamma_ali(u16Hb_entry, u16Gamma, u16Ginv, u16A, u16B, u16S)>>16)*u16MaxInNits); // ( 0.16 -> 0.32 >> 16 -> 0.16 )* 14.0 >> 14.16
        u32Lb_Degamma = ((MDrv_HDR_DeGamma_ali(u16Lb_entry, u16Gamma, u16Ginv, u16A, u16B, u16S)>>16)*u16MaxInNits); // ( 0.16 -> 0.32 >> 16 -> 0.16 )* 14.0 >> 14.16

        // Do PQ on nits of hb, lb
        u16Hb_PQ = MDrv_HDR_PQ_OETF_lavend(u32Hb_Degamma)>>10; // 14.16 -> 10.16 >> 10 -> 10.6
        u16Lb_PQ = MDrv_HDR_PQ_OETF_lavend(u32Lb_Degamma)>>10; // 14.16 -> 10.16 >> 10 -> 10.6

        // Get slope by (PQ(hb)-PQ(lb))>>shift
        u16SlopeTemp = (u16Hb_PQ - u16Lb_PQ) << (2-u8Shift); // 10.6 << (2-1) ->  9.7
        pu16Slope [u8LoopIdx] = (u16SlopeTemp > 0x4000)? 0x4000 : u16SlopeTemp; // max of slope: 128
    }
}
//***************************************************************************************************************************************************
// function: MDrv_HDR_ACAdaptiveGainGen
// note: generate ac gain lut (gamma to gamma)
// input: pCurve18 (12.0), u8Dlc_Mode (8.0), u16MaxOutNits (16.0), u16MaxInNits (16.0), ST_TRANSFER_FUNCTION_DATA* pData
// output: ST_HDR_AC_GAIN* Struct (MS_U8 u8uGain (3.5), MS_U16 u16max (5.11), MS_U16 u16min (5.11), MS_U32 u8acGainLut[24] (5.11))
// reference functions: void MDrv_HDR_GetSlopeOfGamma2PQ(MS_U16* pu16Slope, MS_U8* u8Entry, MS_U8 u8InputLength, MS_U16 u16MaxInNits)
//***************************************************************************************************************************************************
//***************************************************************************************************************************************************
// function: MDrv_HDR_ACAdaptiveGainGen
// note: generate ac gain lut (gamma to gamma)
// input: pCurve18 (12.0), u8Dlc_Mode (8.0), u16MaxOutNits (16.0), u16MaxInNits (16.0), ST_TRANSFER_FUNCTION_DATA* pData
// output: ST_HDR_AC_GAIN* Struct (MS_U8 u8uGain (3.5), MS_U16 u16max (5.11), MS_U16 u16min (5.11), MS_U32 u8acGainLut[24] (5.11))
// reference functions: void MDrv_HDR_GetSlopeOfGamma2PQ(MS_U16* pu16Slope, MS_U8* u8Entry, MS_U8 u8InputLength, MS_U16 u16MaxInNits)
//***************************************************************************************************************************************************
void MDrv_HDR_ACAdaptiveGainGen_lavend(ST_HDR_AC_GAIN* pStruct,
                                       MS_U8 u8Dlc_Mode,
                                       MS_U16* pCurve,
                                       MS_U16 u16MaxOutNits,
                                       MS_U16 u16MaxInNits)
{




    // Bound Nits in [REG_MIN_Nits_lavend, REG_MAX_Nits_lavend]
    //MS_U16 u16oNits = (u16MaxOutNits<REG_MIN_Nits_lavend)? REG_MIN_Nits_lavend: (u16MaxOutNits<REG_MAX_Nits_lavend)? u16MaxOutNits: REG_MAX_Nits_lavend;  //unused
    //MS_U16 u16iNits = (u16MaxInNits<REG_MIN_Nits_lavend)? REG_MIN_Nits_lavend: (u16MaxInNits<REG_MAX_Nits_lavend)? u16MaxInNits: REG_MAX_Nits_lavend;



    // Calculate each entry of AC adaptive gain
    MS_U8 u8LoopIdx;
    MS_U16 u16SGamma_pivots;
    MS_U8 u8Index;
    MS_U8 u8Offset;
    MS_U8 u8OffsetCorrect;
    MS_U16 u16InSlope[REG_ACG_LUT_Length];
    MS_U16 u16OutSlope[REG_ACG_LUT_Length];
    MS_U8 u8TMOOut[REG_ACG_LUT_Length];
    MS_U32 u32TempGain;
    MS_U16 u32GainDiv;
    MS_U16 avgx = 0;
    MS_U32 avgy = 0;
    MS_S32 diffx = 0;
    MS_S32 diffy = 0;;
    MS_S32 covxy = 0;
    MS_U32 varx = 0;
    MS_U32 beta0 = 0;
    MS_U32 beta1 = 0;
    MS_U8  slope_sign = 0;

    // Set entry of Source gamma code: 0~255
    MS_U8 u8SGamma_pivots[REG_ACG_LUT_Length] = {0x00, 0x08, 0x10, 0x18, 0x20, 0x28, 0x30, 0x38, 0x40, 0x48, 0x50, 0x58, 0x60, 0x68, 0x70, 0x78, 0x80, 0x90, 0xA0, 0xB0, 0xC0, 0XD0, 0XE0, 0xFF};
        // Set unit AC adaptive gain
    pStruct->u8uGain = REG_User_Gain_lavend;
    // Set max and min of AC adaptive gain
    pStruct->u16max = REG_MAX_Gain_lavend;
    pStruct->u16min = REG_MIN_Gain_lavend;


    // Map Source gamma to Target gamma by TMO
    if (u8Dlc_Mode==2)
    {
        for( u8LoopIdx = 0; u8LoopIdx < REG_ACG_LUT_Length; u8LoopIdx ++ )
        {
            u16SGamma_pivots = 0x0008 + u8SGamma_pivots[u8LoopIdx];
            u8Index =  u16SGamma_pivots >> 4; // index of [0, 0x020 : 0x040 : 0x3E0, 0x3FF]>>10
            u8Offset = u16SGamma_pivots & 0x0F;
            u8OffsetCorrect = (u8Index == 0)? (u8SGamma_pivots[u8LoopIdx] & 0x0F)<<1 : (u8Index == 16)? u8Offset<<1 : u8Offset;
            u8TMOOut[u8LoopIdx] = ((0x0010 - u8OffsetCorrect) * pCurve [u8Index] + (u8OffsetCorrect) * pCurve [u8Index+1])>>8;
        }
    }
    else
    {
        for( u8LoopIdx = 0; u8LoopIdx < REG_ACG_LUT_Length; u8LoopIdx ++ )
        {
            u16SGamma_pivots=u8SGamma_pivots[u8LoopIdx];
            u8TMOOut[u8LoopIdx]=pCurve [u16SGamma_pivots<<1]>>4; // 0.8 << 1 -> 0.9 -> 4.12 >> 4 -> 0.8
        }
    }

        // Get slope_in and slope_out
        MDrv_HDR_GetSlopeOfGamma2PQ_lavend (u16InSlope , u8SGamma_pivots, REG_ACG_LUT_Length, u16MaxInNits); // 0.8 -> 9.7
        MDrv_HDR_GetSlopeOfGamma2PQ_lavend (u16OutSlope, u8TMOOut       , REG_ACG_LUT_Length, u16MaxOutNits);// 0.8 -> 9.7

        // Calculate AC adaptive gain by Slope_in / Slope_out
    for( u8LoopIdx = 0; u8LoopIdx < 24; u8LoopIdx ++ )
    {
        u32GainDiv = (u16OutSlope[u8LoopIdx] == 0)? 0x4000 : 0x10000/u16OutSlope[u8LoopIdx];
        u32TempGain = ((MS_U32)u16InSlope[u8LoopIdx] * u32GainDiv) >> 5; // 16-11
        pStruct->u8acGainLut [u8LoopIdx] = ((u32TempGain < 0)? 0 : (u32TempGain < 0xffff)? u32TempGain : 0xffff);
    }

        // Do Linear regression
    for( u8LoopIdx = 3; u8LoopIdx < 24; u8LoopIdx ++ )
    {
        avgx += u8SGamma_pivots[u8LoopIdx];
        avgy += pStruct->u8acGainLut [u8LoopIdx];
    }
    avgx /= 21; //0.8
    avgy /= 21; //5.11
    for( u8LoopIdx = 3; u8LoopIdx < 24; u8LoopIdx ++ )
    {
        diffx  = (MS_S32)u8SGamma_pivots[u8LoopIdx] - avgx; //S0.8
        diffy  = (MS_S32)pStruct->u8acGainLut [u8LoopIdx] - avgy; //S5.11
        covxy += diffx * diffy; //S5.19
        varx  += diffx * diffx; //0.16
    }
    slope_sign = (covxy < 0)? 1: 0;
    covxy = (slope_sign == 0)? covxy: -covxy; //5.19
    beta1 = ((MS_U64) covxy << 16) / varx; //5.19 << 16 -> 5.35 / 0.16 ->5.19
    beta0 = (MS_U32) 0x10000 + avgy - ((slope_sign == 0)? (beta1 * avgx)>>16 : -((beta1 * avgx)>>16)); // 5.11 - 5.19 * 0.8 >> 16 -> 5.11

    for( u8LoopIdx = 0; u8LoopIdx < 24; u8LoopIdx ++ )
    {
        u32TempGain = beta0 + ((slope_sign == 0)? (beta1*u8SGamma_pivots[u8LoopIdx])>>16 : -((beta1*u8SGamma_pivots[u8LoopIdx])>>16)); // 5.11 - 5.19 * 0.8 >> 16 -> 5.11
        u32TempGain = (u32TempGain < 0x10000)? 0 : u32TempGain-0x10000;
        pStruct->u8acGainLut [u8LoopIdx] = ((u32TempGain < 0)? 0 : (u32TempGain < 0xffff)? u32TempGain : 0xffff);
        //printk("===========[%s][%d][(%d)-AC_Gain:%x]===========\n",__FUNCTION__,__LINE__,u8LoopIdx,pStruct->u8acGainLut [u8LoopIdx]);
    }

    //HdrAcGainWrite2Register(1, 1, 0xFF, pStruct);
    HdrAcGainWriteLUT(pStruct);
    //KApi_XC_MLoad_Fire(E_CLIENT_MAIN_HDR, TRUE);
    return;
}

